import React from "react";
import Logo from "../../assets/navbar_logo.svg"
import Back from "../../assets/back.png"
const Navbar = () =>{
    return(
        <div className="navbar">
            <img src={Logo} alt="" className="navbar_logo">
            <img src={Back} alt="" className="navbar_back"/>
            <div className="navbar_text">SHARED CLIPBOARD</div>
            <div className="navbar_login">SING IN</div>
            <div className="navbar_registartion">SING UP</div>
            </img>
        </div>
    )
}

export default Navbar;
